  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Centers for Medicare and Medicaid
  Services (CMS) implemented the Comprehensive Error Rate Testing (CERT) program to
  measure improper payments in the Medicare fee-for-service (FFS) program. The Department
  of Health and Human Services (HHS) Office of Inspector General (OIG) estimated the
  Medicare FFS error rate from 1996 through 2002.  The OIG designed its sampling method
  to estimate a national Medicare FFS paid claims error rate.  Due to the sample size
  \ approximately 6,000 claims  the OIG was unable to produce error rates by contractor
  type, specific contractor, service type, or provider type.</p>n\",\n\t\"license_title\":
